interface IProps {
  items: string;
}
const ItemTopics = () => {
  return (
    <div className="repo-item__topics">
      {topics.map((topic) => {
        return <div className="topic">{topic}</div>;
      })}
    </div>
  );
};

export default ItemTopics;
